import Layout from '../components/Layout';
import Form from '../components/Form';
import JobList from '../components/JobLists';

const Index = () => {
    return (
        <div>
            <Layout>
                <Form />
                <JobList />
            </Layout>
        </div>
    );
};

export default Index;
